import './HomePage.scss';

import profileUrl from '../../assets/pictures/profile.jpeg';

function HomePage () {

    return(
        <main className="home">
            <div className="home__profile">
                <div className="home__profile-avatar">
                    <img className="home__profile-img" src={profileUrl} alt="profile"/>
                </div>
                <div className="home__profile-info">

                </div>
            </div>

        </main>
    )
}

export default HomePage;
